import React, { useState } from 'react';

function Form(){
    const submit =() =>{
        console.log("submit");
        var frm = document.getElementsByName('form-report')[0];
        frm.submit();
       // frm.reset();
        return false;

    }
    const taketoreport = () =>{
        window.location.href="/report";
    }
    return(
        <div class="page3">
        <input type="file" onClick={taketoreport} class="page3-1" src="icon/Vector.png" />
            <div class="page3-2">
                <p class="page3-2-1">Report violation </p>
                <form action="/report">
                    <label for="picture" class="upload">Upload Picture</label><br/>
                    <input type="image" class="img" src="icon/Group 7.png"  name="picture" />
                    <div class="after-upload"><button class="reupload" type="button" onclick="uploadagain()">Reupload</button>
                    <img id="upload-img" src="icon/VES_Awards_89_cropped 1.png"  alt="noimage"/></div>
                    <hr class="line"/>
                    <label for="Add" class="page3-2-2">Address</label><br/>
                    <input type="text" class="add page3-2-2-2"  name="add" required /><br/>

                    <label for="City" class="page3-2-2">City</label>
                    <label for="State" class="page3-2-2-1">State</label>
                    <label for="Pin" class="page3-2-2-1">Pin</label><br/>
                    <input type="text" class="City page3-2-2-2" name="City" required />
                    <input type="text" class="State page3-2-2-2" name="State" required />
                    <input type="number" class="pin page3-2-2-2" name="Pin" required /><br/>

                    <label for="Cont" class="page3-2-2">Contact Number</label><br/>
                    <input type="number" class="add page3-2-2-2" name="Cont" required /><br/>

                    <label for="Title" class="page3-2-2">Title</label><br/>
                    <input type="text" class="add page3-2-2-2" name="Title" required /><br/>

                    <label for="Details" class="page3-2-2">Details</label><br/>
                    <input type="text" class="Details page3-2-2-2" name="Details" required /><br/>

                    <input type="submit" class="submit" value="Submit"/>
            </form> 


            </div>

        </div>
    );
}

export default Form;
